                    "x": 888.0,
                    "y": 540.0,
                    "tooltip": "\u57fa\u7840\u602a\u7269\u9632\u62a4",
                    "data": "\u5728\u4f60\u57fa\u5730\u9644\u8fd1\u751f\u6210\u7684\u602a\u7269\u592a\u70e6\u4eba\u4e86,\u7279\u522b\u662f\u5f53\u4f60\u78b0\u5230\u706b\u7130\u722c\u884c\u8005\u7684\u65f6\u5019.\u5e78\u8fd0\u7684\u662f,\u6709\u4e00\u79cd\u65b9\u6cd5\u53ef\u4ee5\u963b\u6b62\u5b83\u4eec\u751f\u6210."
