                    "tooltip": "\u8282\u70b9\u5347\u7ea7",
                    "data": "\u8282\u70b9\u53ef\u4ee5\u8fdb\u884c\u8bb8\u591a\u5347\u7ea7. \u73b0\u5728,\u5c1d\u8bd5\u5236\u4f5c\u8282\u70b9\u5347\u7ea7:\u4e16\u754c\u4ea4\u4e92(WIU). \u6709\u4e86\u5b83,\u4f60\u53ef\u4ee5\u8bbe\u7f6e\u7b80\u5355\u7684\u81ea\u52a8\u5316.%n%n\u5728\u8fde\u63a5\u5230\u5de5\u4f5c\u53f0\u7684\u4f20\u8f93\u8282\u70b9\u4e2d\u653e\u7f6e\u4e00\u4e2aWIU.\u5de5\u4f5c\u53f0\u53e6\u4e00\u4fa7\u76843x3\u533a\u57df\u5c31\u4f1a\u88ab\u89c6\u4e3a\u5408\u6210\u680f. \u5c06\u7269\u54c1\u653e\u5728\u53e6\u4e00\u4fa7\u7684\u5e93\u5b58\u4e2d,\u5982\u679c\u5b83\u4eec\u7684\u5408\u6210\u8868\u6709\u6548,WIU\u5c06\u5236\u4f5c\u5b83. \u4e3a\u4e86\u52a0\u5feb\u901f\u5ea6,\u4f60\u9700\u8981\u7b49\u5230HV\u9636\u6bb5,\u7528\u4e0d\u9508\u94a2\u5236\u4f5c\u8282\u70b9\u5347\u7ea7:\u901f\u5ea6\u63d0\u5347.%n%n\u53e6\u5916,\u5f53\u4f60\u5c06\u4e00\u4e2a\u8282\u70b9\u653e\u5728\u4e00\u5757\u5706\u77f3\u4e0a,\u5e76\u5728\u7d27\u90bb\u5706\u77f3\u653e\u7f6e\u5ca9\u6d46\u548c\u6c34,\u518d\u5728\u8282\u70b9\u4e2d\u653e\u5165WIU,\u5b83\u5c31\u80fd\u81ea\u52a8\u4e3a\u4f60\u51fa\u4ea7\u5706\u77f3.\u4f7f\u7528\u5347\u7ea7\u63d0\u5347\u6bcf\u6b21\u83b7\u53d6\u6570\u91cf\u548c\u901f\u5ea6.%n%n\u5728GTNH,WIU\u65e0\u6cd5\u5236\u9020\u65e0\u9650\u6c34."
