                {
                    "name": "\u4f60\u4f1a\u975e\u5e38\u8ba8\u538c\u8fd9\u4e2a #6",
                    "symbolSize": 62.400000000000006,
                    "symbol": "image://version/272/quests_icons/QuestIcon/530.png",
                    "x": 1140.0,
                    "y": 324.0,
                    "tooltip": "\u4f60\u4f1a\u975e\u5e38\u8ba8\u538c\u8fd9\u4e2a #6",
                    "data": "\u7b2c\u516d\u79cd\u4f60\u9700\u8981\u5f88\u591a\u7684\u90e8\u4ef6. \u7528\u4e8e\u5236\u9020\u626b\u63cf\u4eea\u548c\u5730\u9707\u52d8\u63a2\u8005.%n%n\u987a\u4fbf\u63d0\u4e00\u53e5,\u7406\u8bba\u4e0a\u8fd8\u6709\u4e00\u79cd\u90e8\u4ef6--\u529b\u573a\u53d1\u751f\u5668--\u4f46\u5b83\u9700\u8981\u7528\u5230\u66f4\u9ad8\u9636\u7684\u7535\u8def\u677f,\u5e76\u4e14\u5728\u540e\u671f\u4e4b\u524d\u5e76\u4e0d\u7b97\u5e38\u7528."
                },
                {
                    "name": "\u4f60\u4f1a\u975e\u5e38\u8ba8\u538c\u8fd9\u4e2a #5",
                    "symbolSize": 62.400000000000006,
                    "symbol": "image://version/272/quests_icons/QuestIcon/529.png",
                    "x": 1068.0,
                    "y": 324.0,
                    "tooltip": "\u4f60\u4f1a\u975e\u5e38\u8ba8\u538c\u8fd9\u4e2a #5",
                    "data": "\u5728\u5236\u9020\u5fae\u6ce2\u7089\u3001\u626b\u63cf\u4eea\u548c\u6700\u91cd\u8981\u7684\u7535\u8def\u7ec4\u88c5\u673a\u8fd8\u6709\u7cbe\u5bc6\u6fc0\u5149\u8680\u523b\u673a\u7684\u65f6\u5019\u4f60\u4f1a\u9700\u8981\u8fd9\u4e2a\u4e1c\u897f.%n%n\u5e78\u8fd0\u7684\u662f,\u53d1\u5c04\u5668\u548c\u4f20\u611f\u5668\u4e0d\u50cf\u5176\u4ed6\u90e8\u4ef6\u90a3\u6837\u9700\u8981\u90a3\u4e48\u591a."
                },
                {
                    "name": "\u4f60\u7684\u9b54\u6cd5\u4e4b\u8def",
                    "symbolSize": 31.200000000000003,
                    "symbol": "image://version/272/quests_icons/QuestIcon/104.png",
                    "x": 828.0,
                    "y": 144.0,
                    "tooltip": "\u4f60\u7684\u9b54\u6cd5\u4e4b\u8def",
                    "data": "\u73b0\u5728\u4f60\u70bc\u51fa\u4e86\u94dd,\u53ef\u4ee5\u5f00\u59cb\u7814\u7a76\u9b54\u6cd5\u4e86.\u5982\u679c\u4f60\u8fd8\u6ca1\u89e3\u9501\u795e\u79d8\u4efb\u52a1,\u8bd5\u7740\u627e\u5230\u94f6\u6811\u6811\u82d7\u8ddf\u5b8f\u4f1f\u4e4b\u6811\u6811\u82d7.%n%n\u4f60\u8fd8\u53ef\u4ee5\u4f7f\u7528\u786c\u5e01\u8d2d\u4e70\u8fd9\u4e9b\u6811\u82d7.\u5982\u679c\u4f60\u4ecd\u672a\u627e\u5230\u7684\u8bdd,\u8fd9\u5c31\u53bb\u770b\u770b\u5427!"
                },
                {
                    "name": "\u77f3\u6cb9\u63d0\u7eaf",
                    "symbolSize": 62.400000000000006,
                    "symbol": "image://version/272/quests_icons/QuestIcon/547.png",
                    "x": 480.0,
                    "y": 408.0,
                    "tooltip": "\u77f3\u6cb9\u63d0\u7eaf",
                    "data": "\u7528\u77f3\u6cb9\u505a\u5185\u71c3\u53d1\u7535\u673a\u7684\u71c3\u6599\u662f\u4e00\u79cd\u975e\u5e38\u4f4e\u6548\u7387\u4e14\u6d6a\u8d39\u7684\u4e8b\u60c5(1\u6876\u77f3\u6cb9\u71c3\u70e7\u540e\u4ec5\u63d0\u4f9b20,000EU\u7684\u7535\u91cf).\u662f\u65f6\u5019\u63d0\u7eaf\u77f3\u6cb9\u4e86!%n%n\u4f60\u9700\u8981\u7528\u7f16\u7a0b\u7535\u8def\u9009\u62e9\u67d0\u4e00\u79cd\u9700\u8981\u7684\u4ea7\u7269.\u4e4b\u540e\u7684\u591a\u65b9\u5757\u84b8\u998f\u5854\u53ef\u4ee5\u83b7\u5f97\u6240\u6709\u4ea7\u7269,\u4f46\u79bb\u73b0\u5728\u8fd8\u6709\u4e00\u6bb5\u8ddd\u79bb.%n%n\u4f60\u8fd8\u53ef\u4ee5\u84b8\u998f\u51fa\u8bb8\u591a\u5176\u4ed6\u6d41\u4f53!\u6709\u4e24\u79cd\u6d41\u4f53\u5f88\u6709\u7528,\u4f46\u84b8\u998f\u9700\u8981\u5f88\u957f\u65f6\u95f4,\u6240\u4ee5\u4f60\u6700\u597d\u63d0\u524d\u505a\u597d\u5b83\u4eec\u7684\u81ea\u52a8\u5316.\u8fd9\u4e24\u79cd\u6d41\u4f53\u5206\u522b\u662f:\u6da6\u6ed1\u6cb9(\u6765\u81ea\u6742\u915a\u6cb9)\u548c\u84b8\u998f\u6c34(\u6765\u81ea\u6c34)."
                }
